import axios from 'axios';
const auth = (jwt) => {
    //alert(jwt);
    if(jwt){
        axios
        .post("http://localhost:3001/auth",jwt)
        .then(function (response) {
                alert(response.data);
                
            })
            .catch(err => {
                console.error(err);
            });
    }
    else {
        return false;
    }
}

export default auth;
